import React, { Component } from "react";
class InputBox extends Component {
  render() {
    return <div id="I-outer">Upload Image</div>;
    <div id="I-inner">
      <img src="https://png.pngtree.com/svg/20161117/live__plus_icon_1099279.png" />
    </div>;
  }
}
export default InputBox;
